import React from "react";
import Head from "next/head";

const Layout = ({ title }) => {
  return (
    <div>
      <Head>
        <title>RAVENS | Special Film Tactics</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>
    </div>
  );
};
export default Layout;
